import React from 'react';
import "./User.css";
import Grid from '@material-ui/core/Grid';
import { Typography, Button, Container } from '@material-ui/core';
import { useStyles } from './Home';

const User = props => {
    const classes = useStyles();
    const usersData = props.items;
    let count = 1;
    const artistData = usersData.map((artist) =>
    <div className={classes.root}>
    <Grid container spacing={3}>
      <Grid item xs={3}>
        <h1 className="count" >#{count++}</h1>
      </Grid>
      <Grid item xs={6}>
      <a href={artist.external_urls.spotify} target="_blank" rel="noopener noreferrer">
                        <img src={artist.images[0].url} alt="artist" className="image"/>
                    </a>
      </Grid>
      <Grid item xs={9}>
        <h1 className="artistName">{artist.name}</h1>
      </Grid>
    </Grid>
  </div>
    ) 
    return (
        <div className="section">
             <button onClick={() => props.handleClick("artists")}> click for artists</button>
            <h1>Your Top 10 Favorite Artist</h1>
            {artistData}
        </div>
    )
}
export default User;
